INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60000, 0, 1, 190804, 1, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 60000, 1, 2, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60000, 1, 3, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 60000, 1, 4, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 60000, 2, 5, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 60000, 2, 6, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 60000, 2, 7, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 60000, 3, 8, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 60000, 3, 9, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60000, 3, 10, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60000, 3, 11, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 60000, 3, 12, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 60000, 4, 13, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 60000, 4, 14, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 60000, 4, 15, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60000, 4, 16, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60000, 4, 17, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60000, 0, 18, 190804, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 3, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60000, 0, 19, 190804, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ハツネ", 0, 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 80001, 0, 20, 101201, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ハツネ", 0, 1, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 80001, 0, 21, 101201, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シオリ", 1, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 80001, 0, 22, 103801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シオリ", 1, 1, "来年も、\n一緒にいられたら…\nうれしいな", 80001, 0, 23, 103801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キョウカ", 0, 2, "あなたと一緒にいるようになって、\nもう1年ですか…", 80001, 0, 24, 103601, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キョウカ", 0, 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 80001, 0, 25, 103601, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミミ", 1, 2, "おにいちゃんとあってから、\n1年たったよ～！", 80001, 0, 26, 102001, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミミ", 1, 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 80001, 0, 27, 102001, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミソギ", 2, 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 80001, 0, 28, 100401, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミソギ", 2, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 80001, 0, 29, 100401, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("マホ", 0, 3, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 80001, 0, 30, 101001, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("マホ", 0, 3, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 80001, 0, 31, 101001, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("イリヤ", 1, 3, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 80001, 0, 32, 104401, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("イリヤ", 1, 3, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 80001, 0, 33, 104401, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カオリ", 2, 3, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 80001, 0, 34, 101701, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カオリ", 2, 3, "これからも、どうぞよろしく\nお願いするさ～！", 80001, 0, 35, 101701, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("サレン", 0, 4, "あんたと出会ってからもうそんなに\nたつのね～", 80001, 0, 36, 102801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("サレン", 0, 4, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 80001, 0, 37, 102801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("スズメ", 1, 4, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 80001, 0, 38, 102501, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("スズメ", 1, 4, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 80001, 0, 39, 102501, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("タマキ", 0, 5, "振り返れば、今までいろんなことが\nあったにゃあ…", 80001, 0, 40, 104601, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("タマキ", 0, 5, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 80001, 0, 41, 104601, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミフユ", 1, 5, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 80001, 0, 42, 104801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミフユ", 1, 5, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 80001, 0, 43, 104801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("アキノ", 0, 6, "あなたさまと出会ってもう1年…", 80001, 0, 44, 103201, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("アキノ", 0, 6, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 80001, 0, 45, 103201, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ユカリ", 1, 6, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 80001, 0, 46, 103401, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ユカリ", 1, 6, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 80001, 0, 47, 103401, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("クリスティーナ", 0, 7, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 80001, 0, 48, 107101, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("クリスティーナ", 0, 7, "ともかくこれからも\n愉しませてくれよ☆", 80001, 0, 49, 107101, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ジュン", 1, 7, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 80001, 0, 50, 104701, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ジュン", 1, 7, "見えないから分からないって？\nそれもそうだな…", 80001, 0, 51, 104701, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("トモ", 0, 8, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 80001, 0, 52, 103701, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("トモ", 0, 8, "これからもよろしくね！", 80001, 0, 53, 103701, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("マツリ", 1, 8, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 80001, 0, 54, 100501, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("マツリ", 1, 8, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 80001, 0, 55, 100501, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミヤコ", 0, 9, "オマエと会って1年なの！\n全然成仏もできなかったし、", 80001, 0, 56, 100701, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミヤコ", 0, 9, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 80001, 0, 57, 100701, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シノブ", 1, 9, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 80001, 0, 58, 103101, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シノブ", 1, 9, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 80001, 0, 59, 103101, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("アンナ", 0, 10, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 80001, 0, 60, 100901, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("アンナ", 0, 10, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 80001, 0, 61, 100901, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ナナカ", 1, 10, "君と出会ってもう1年だって！\n早いねー！", 80001, 0, 62, 101301, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ナナカ", 1, 10, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 80001, 0, 63, 101301, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミツキ", 0, 11, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 80001, 0, 64, 105101, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ミツキ", 0, 11, "これからも、いろんなところを\n調べさせてね？", 80001, 0, 65, 105101, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ルカ", 1, 11, "お前さんと出会ってもう1年か\n助太刀するつもりが", 80001, 0, 66, 105601, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ルカ", 1, 11, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 80001, 0, 67, 105601, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("エリコ", 2, 11, "早いものですわね、あなた様と\nお会いして、もう1年…", 80001, 0, 68, 102701, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("エリコ", 2, 11, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 80001, 0, 69, 102701, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("アヤネ", 0, 12, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 80001, 0, 70, 102301, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("アヤネ", 0, 12, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 80001, 0, 71, 102301, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("チカ", 1, 12, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 80001, 0, 72, 104201, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("チカ", 1, 12, "私のことを見守ってください\nできることなら、ずっと…", 80001, 0, 73, 104201, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("クルミ", 2, 12, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 80001, 0, 74, 102101, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("クルミ", 2, 12, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 80001, 0, 75, 102101, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シズル", 0, 13, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 80001, 0, 76, 104901, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シズル", 0, 13, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 80001, 0, 77, 104901, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("リノ", 1, 13, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 80001, 0, 78, 101101, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("リノ", 1, 13, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 80001, 0, 79, 101101, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ユイ", 0, 14, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 80001, 0, 80, 100201, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ユイ", 0, 14, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 80001, 0, 81, 100201, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ヒヨリ", 1, 14, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 80001, 0, 82, 100101, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ヒヨリ", 1, 14, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 80001, 0, 83, 100101, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("レイ", 2, 14, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 80001, 0, 84, 100301, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("レイ", 2, 14, "キミに背中を預けられる日が、\n早くきますように", 80001, 0, 85, 100301, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 80001, 0, 86, 105801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "これからもずっと、覚えていて\nくださいね！", 80001, 0, 87, 105801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 80001, 0, 88, 105901, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 80001, 0, 89, 105901, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 80001, 0, 90, 106001, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 80001, 0, 91, 106001, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("スズメ", 1, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 60001, 0, 92, 112101, 1, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 60001, 1, 93, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60001, 1, 94, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 60001, 1, 95, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 60001, 1, 96, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 60001, 1, 97, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 60001, 2, 98, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 60001, 2, 99, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 60001, 2, 100, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 60001, 2, 101, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 60001, 2, 102, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 60001, 3, 103, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 60001, 3, 104, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60001, 3, 105, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60001, 3, 106, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 60001, 3, 107, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 60001, 3, 108, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 60001, 3, 109, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 60001, 4, 110, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 60001, 4, 111, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 60001, 4, 112, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60001, 4, 113, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 60001, 4, 114, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 60001, 4, 115, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60001, 4, 116, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("スズメ", 3, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 60001, 0, 117, 112101, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("スズメ", 3, 7, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 60001, 0, 118, 112101, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 1, "ヒューヒュー♪\nドンドンパフパフー♪", 80003, 0, 119, 105801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 80003, 0, 120, 105901, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 80003, 0, 121, 105901, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 1, "え？　ちょっと\nいきなりなにっ？", 80003, 0, 122, 106001, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 1, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 80003, 0, 123, 106001, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 1, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 80003, 0, 124, 105801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 1, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 80003, 0, 125, 105801, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 80003, 0, 126, 105901, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 1, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 80003, 0, 127, 106001, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 80003, 0, 128, 105901, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 1, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 80003, 0, 129, 105801, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 1, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 80003, 0, 130, 106001, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 80003, 0, 131, 105901, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 80003, 0, 132, 106001, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 2, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 80003, 0, 133, 190801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "げっ…カリンじゃない\nなんでもないわよ！", 80003, 0, 134, 106001, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 80003, 0, 135, 190801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 80003, 0, 136, 106001, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 2, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 80003, 0, 137, 190801, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 80003, 0, 138, 106001, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 80003, 0, 139, 106001, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 2, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 80003, 0, 140, 190801, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 80003, 0, 141, 106001, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 2, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 80003, 0, 142, 190801, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 80003, 0, 143, 106001, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 3, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 80003, 0, 144, 105901, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 1, 3, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 80003, 0, 145, 105801, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 3, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 80003, 0, 146, 105901, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 3, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 80003, 0, 147, 105901, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 1, 3, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 80003, 0, 148, 105801, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 1, 3, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 80003, 0, 149, 105801, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 3, "あとは、牧場に素敵な温泉が\n出来たとか…", 80003, 0, 150, 105901, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 1, 3, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 80003, 0, 151, 105801, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 3, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 80003, 0, 152, 105901, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 1, 3, "えへへ、ありがとうございます\nコッコロちゃん！", 80003, 0, 153, 105801, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 3, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 80003, 0, 154, 105901, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 1, 3, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 80003, 0, 155, 105801, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 4, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 80003, 0, 156, 105801, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 4, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 80003, 0, 157, 106001, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 4, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 80003, 0, 158, 105801, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 4, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 80003, 0, 159, 106001, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 4, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 80003, 0, 160, 105801, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 4, "…積極的？\nなんの話よ？", 80003, 0, 161, 106001, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 4, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 80003, 0, 162, 105801, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 4, "ムーサの町で\nきゃるきゃる～ん☆　って！", 80003, 0, 163, 105801, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 4, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 80003, 0, 164, 106001, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 4, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 80003, 0, 165, 105801, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 4, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 80003, 0, 166, 106001, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 4, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 80003, 0, 167, 106001, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 80003, 0, 168, 106001, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 5, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 80003, 0, 169, 105901, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 80003, 0, 170, 106001, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 5, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 80003, 0, 171, 105901, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 80003, 0, 172, 106001, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 5, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 80003, 0, 173, 105901, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 80003, 0, 174, 106001, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 5, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 80003, 0, 175, 105901, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "かくし芸？", 80003, 0, 176, 106001, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 5, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 80003, 0, 177, 105901, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 80003, 0, 178, 106001, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 6, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 80003, 0, 179, 105801, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 6, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 80003, 0, 180, 106001, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 6, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 80003, 0, 181, 105901, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 6, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 80003, 0, 182, 105801, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 6, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 80003, 0, 183, 106001, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 6, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 80003, 0, 184, 105901, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 6, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 80003, 0, 185, 106001, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 6, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 80003, 0, 186, 106001, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 6, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 80003, 0, 187, 106001, 0, 28, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 6, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 80003, 0, 188, 105801, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 6, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 80003, 0, 189, 105901, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 6, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 80003, 0, 190, 106001, 0, 29, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 80003, 0, 191, 106001, 0, 30, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 80003, 0, 192, 106001, 0, 31, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 80003, 0, 193, 106001, 0, 32, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "あー\nあー\n…声、これで大丈夫かしら？", 80003, 0, 194, 106001, 0, 33, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 80003, 0, 195, 106001, 0, 34, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "オイッスー☆", 80003, 0, 196, 106001, 0, 35, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 80003, 0, 197, 106001, 0, 36, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 80003, 0, 198, 106001, 0, 37, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 80003, 0, 199, 106001, 0, 38, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 80003, 0, 200, 105901, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 80003, 0, 201, 105901, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 80003, 0, 202, 105901, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 80003, 0, 203, 105901, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 80003, 0, 204, 105901, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "オイッスー☆", 80003, 0, 205, 105901, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 80003, 0, 206, 105901, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 80003, 0, 207, 105901, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 8, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 80003, 0, 208, 105901, 0, 28, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "オイッスー☆", 80003, 0, 209, 105801, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 80003, 0, 210, 105801, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "あと６日で2.5周年ですか…", 80003, 0, 211, 105801, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 80003, 0, 212, 105801, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 80003, 0, 213, 105801, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "オイッスー☆", 80003, 0, 214, 105801, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 80003, 0, 215, 105801, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 80003, 0, 216, 105801, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 80003, 0, 217, 105801, 0, 28, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 80003, 0, 218, 105801, 0, 29, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 9, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 80003, 0, 219, 105801, 0, 30, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 10, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 80003, 0, 220, 105801, 0, 31, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 10, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 80003, 0, 221, 105901, 0, 29, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 10, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 80003, 0, 222, 105801, 0, 32, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 10, "…………", 80003, 0, 223, 106001, 0, 39, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 10, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 80003, 0, 224, 105901, 0, 30, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 10, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 80003, 0, 225, 106001, 0, 40, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 10, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 80003, 0, 226, 105801, 0, 33, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 10, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 80003, 0, 227, 106001, 0, 41, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 10, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 80003, 0, 228, 105801, 0, 34, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 10, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 80003, 0, 229, 105801, 0, 35, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 10, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 80003, 0, 230, 106001, 0, 42, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 10, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 80003, 0, 231, 105901, 0, 31, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 10, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 80003, 0, 232, 106001, 0, 43, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 10, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 80003, 0, 233, 105801, 0, 36, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 80003, 0, 234, 190801, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 80003, 0, 235, 190801, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 80003, 0, 236, 190801, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 80003, 0, 237, 190801, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 80003, 0, 238, 190801, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "次にコッコロさんですが\nこちらは発声練習をしています", 80003, 0, 239, 190801, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 80003, 0, 240, 190801, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 80003, 0, 241, 190801, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "あれ？\nもしかして緊張で気を失って…？", 80003, 0, 242, 190801, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 80003, 0, 243, 190801, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 80003, 0, 244, 190801, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 11, "それでは\nまた明日お会いしましょう♪", 80003, 0, 245, 190801, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 12, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 80003, 0, 246, 106001, 0, 44, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 2, 12, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 80003, 0, 247, 105801, 0, 37, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 12, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 80003, 0, 248, 105901, 0, 32, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 12, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 80003, 0, 249, 106001, 0, 45, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 2, 12, "ひどいですよぉキャルちゃ～ん！", 80003, 0, 250, 105801, 0, 38, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 12, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 80003, 0, 251, 105901, 0, 33, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 2, 12, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 80003, 0, 252, 105801, 0, 39, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 12, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 80003, 0, 253, 106001, 0, 46, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 12, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 80003, 0, 254, 105901, 0, 34, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 2, 12, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 80003, 0, 255, 105801, 0, 40, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 13, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 80003, 0, 256, 105801, 0, 41, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 13, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 80003, 0, 257, 106001, 0, 47, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 13, "忘れてきちゃいました☆", 80003, 0, 258, 105801, 0, 42, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 13, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 80003, 0, 259, 106001, 0, 48, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 13, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 80003, 0, 260, 105901, 0, 35, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 13, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 80003, 0, 261, 106001, 0, 49, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 13, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 80003, 0, 262, 105801, 0, 43, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 13, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 80003, 0, 263, 106001, 0, 50, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 13, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 80003, 0, 264, 105901, 0, 36, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 13, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 80003, 0, 265, 106001, 0, 51, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 13, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 80003, 0, 266, 105901, 0, 37, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 13, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 80003, 0, 267, 106001, 0, 52, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 13, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 80003, 0, 268, 105801, 0, 44, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 13, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 80003, 0, 269, 105901, 0, 38, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 13, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 80003, 0, 270, 105801, 0, 45, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 13, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 80003, 0, 271, 106001, 0, 53, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 13, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 80003, 0, 272, 105801, 0, 46, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "こんにちは\n【ギルド管理協会】のカリンです", 80003, 0, 273, 190801, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "昨日の生放送は\nいかがだったでしょうか？", 80003, 0, 274, 190801, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 80003, 0, 275, 190801, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 80003, 0, 276, 190801, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 80003, 0, 277, 190801, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 80003, 0, 278, 190801, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 80003, 0, 279, 190801, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 80003, 0, 280, 190801, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 80003, 0, 281, 190801, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 0, 14, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 80003, 0, 282, 190801, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "準備はいいですかっ？\n…いっきますよー！", 80003, 0, 283, 105801, 0, 47, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "祝！", 80003, 0, 284, 106001, 0, 54, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "2.5周年！", 80003, 0, 285, 105901, 0, 39, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "おめでとうございま～す☆", 80003, 0, 286, 105801, 0, 48, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 80003, 0, 287, 106001, 0, 55, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 80003, 0, 288, 105901, 0, 40, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 80003, 0, 289, 105801, 0, 49, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 80003, 0, 290, 106001, 0, 56, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 80003, 0, 291, 105901, 0, 41, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 80003, 0, 292, 106001, 0, 57, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 80003, 0, 293, 105801, 0, 50, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 80003, 0, 294, 106001, 0, 58, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "記念日だから\n平気平気♪\nやばいですね☆", 80003, 0, 295, 105801, 0, 51, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "意味分かんないわよ！", 80003, 0, 296, 106001, 0, 59, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 80003, 0, 297, 105901, 0, 42, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 80003, 0, 298, 105901, 0, 43, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 80003, 0, 299, 105801, 0, 52, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 2, 15, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 80003, 0, 300, 106001, 0, 60, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 15, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 80003, 0, 301, 105901, 0, 44, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 15, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 80003, 0, 302, 105801, 0, 53, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ・コッコロ・キャル", 0, 15, "2.5周年\nありがとうございます！", 80003, 0, 303, 105801, 0, 54, 1, "105901,45,106001,61");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60002, 0, 304, 190804, 1, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 60002, 1, 305, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60002, 1, 306, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 60002, 1, 307, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 60002, 1, 308, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 60002, 1, 309, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 60002, 2, 310, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 60002, 2, 311, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 60002, 2, 312, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 60002, 2, 313, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 60002, 2, 314, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 60002, 3, 315, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 60002, 3, 316, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60002, 3, 317, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 60002, 3, 318, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 60002, 3, 319, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60002, 3, 320, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 60002, 3, 321, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 60002, 4, 322, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 60002, 4, 323, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 60002, 4, 324, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 60002, 4, 325, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 60002, 4, 326, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 60002, 4, 327, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 60002, 4, 328, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60002, 0, 329, 190804, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 3, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60002, 0, 330, 190804, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 1, "ささ、シェフィさまはこちらへ…", 80005, 0, 331, 105901, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 1, "コッコロさん、どこへ行くの…？\n…え？", 80005, 0, 332, 106401, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 80005, 0, 333, 105801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 1, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 80005, 0, 334, 105901, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 1, "ええと…\n二人とも何をしているの？", 80005, 0, 335, 106401, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 80005, 0, 336, 106001, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 1, "あの日…？", 80005, 0, 337, 106401, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 1, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 80005, 0, 338, 105801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 1, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 80005, 0, 339, 105801, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 1, "やばいですね☆", 80005, 0, 340, 190801, 0, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 1, "って、なにしれっと\n参加してんのよカリン！", 80005, 0, 341, 106001, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 1, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 80005, 0, 342, 190801, 0, 2, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 1, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 80005, 0, 343, 190801, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 1, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 80005, 0, 344, 105801, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 1, "えっ！？　ええとええと…！\nあ、あと14日…！", 80005, 0, 345, 106401, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 2, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 80005, 0, 346, 105801, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 2, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 80005, 0, 347, 105901, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 2, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 80005, 0, 348, 105901, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 2, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 80005, 0, 349, 105801, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 2, "さすがでございます\nペコリーヌさま", 80005, 0, 350, 105901, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 80005, 0, 351, 106001, 0, 3, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 80005, 0, 352, 106401, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 2, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 80005, 0, 353, 105801, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 2, "さ、次はキャルさまの\n番でございますよ", 80005, 0, 354, 105901, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 80005, 0, 355, 106001, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 80005, 0, 356, 106401, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 80005, 0, 357, 106001, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 80005, 0, 358, 106001, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 2, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 80005, 0, 359, 105901, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 2, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 80005, 0, 360, 106001, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 3, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 80005, 0, 361, 105901, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 80005, 0, 362, 105801, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 3, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 80005, 0, 363, 105901, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 3, "聖学祭…って、なにかしら？", 80005, 0, 364, 106401, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 3, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 80005, 0, 365, 105901, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 3, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 80005, 0, 366, 106001, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 3, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 80005, 0, 367, 106001, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 80005, 0, 368, 105801, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 3, "いや、そのまんますぎでしょ…", 80005, 0, 369, 106001, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 3, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 80005, 0, 370, 106401, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 80005, 0, 371, 105801, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 3, "えっ？　ええ…\nぎゅーっ…？", 80005, 0, 372, 106401, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 4, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 80005, 0, 373, 106001, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 4, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 80005, 0, 374, 106401, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 4, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 80005, 0, 375, 106001, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 4, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 80005, 0, 376, 105901, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 4, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 80005, 0, 377, 106001, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 4, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 80005, 0, 378, 105801, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 4, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 80005, 0, 379, 106001, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 4, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 80005, 0, 380, 106001, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 4, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 80005, 0, 381, 106401, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 4, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 80005, 0, 382, 105801, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 4, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 80005, 0, 383, 105901, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 4, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 80005, 0, 384, 106001, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 4, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 80005, 0, 385, 106401, 0, 12, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 5, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 80005, 0, 386, 105801, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 5, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 80005, 0, 387, 105801, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 5, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 80005, 0, 388, 105801, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 80005, 0, 389, 106001, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 80005, 0, 390, 106001, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 5, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 80005, 0, 391, 106401, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 5, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 80005, 0, 392, 105901, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 5, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 80005, 0, 393, 105801, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 5, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 80005, 0, 394, 106001, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 5, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 80005, 0, 395, 105801, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 5, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 80005, 0, 396, 105801, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 5, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 80005, 0, 397, 105801, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 6, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 80005, 0, 398, 190801, 0, 4, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 6, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 80005, 0, 399, 190801, 0, 5, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 6, "…えっ！？", 80005, 0, 400, 106001, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 6, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 80005, 0, 401, 105801, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 6, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 80005, 0, 402, 106401, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 6, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 80005, 0, 403, 105901, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 6, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 80005, 0, 404, 106401, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 6, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 80005, 0, 405, 106001, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 6, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 80005, 0, 406, 105801, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 6, "ぶっ殺すぞ！？", 80005, 0, 407, 106001, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 80005, 0, 408, 190801, 0, 6, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 7, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 80005, 0, 409, 105901, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 80005, 0, 410, 106001, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 7, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 80005, 0, 411, 106401, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 7, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 80005, 0, 412, 105801, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 80005, 0, 413, 106001, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 7, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 80005, 0, 414, 106401, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 7, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 80005, 0, 415, 105901, 0, 16, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 7, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 80005, 0, 416, 106401, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 7, "もちろんでございます\n仲良くお勉強いたしましょう", 80005, 0, 417, 105901, 0, 17, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "しれっと教育ママが\n生まれてる…？", 80005, 0, 418, 106001, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 7, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 80005, 0, 419, 105801, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 7, "え～～～～！？", 80005, 0, 420, 106001, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 8, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 80005, 0, 421, 106001, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 8, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 80005, 0, 422, 106401, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 8, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 80005, 0, 423, 105901, 0, 18, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 8, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 80005, 0, 424, 105801, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 8, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 80005, 0, 425, 106401, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 8, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 80005, 0, 426, 106001, 0, 28, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 8, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 80005, 0, 427, 105901, 0, 19, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 8, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 80005, 0, 428, 106401, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 8, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 80005, 0, 429, 106001, 0, 29, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 8, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 80005, 0, 430, 106001, 0, 30, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 8, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 80005, 0, 431, 105801, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 8, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 80005, 0, 432, 106001, 0, 31, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 80005, 0, 433, 106401, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "…えっ？\n生放送の意気込み！？\n突然なに！？", 80005, 0, 434, 106401, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 80005, 0, 435, 106401, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 80005, 0, 436, 106401, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 80005, 0, 437, 106401, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "それから、それから…！\nぅ、ぅぅっ…！", 80005, 0, 438, 106401, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "―びえぇぇ～んっ！！！", 80005, 0, 439, 106401, 0, 28, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 9, "どうされましたか、シェフィさま", 80005, 0, 440, 105901, 0, 20, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "ううっ…ひっく…\nママッ…！", 80005, 0, 441, 106401, 0, 29, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 9, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 80005, 0, 442, 105901, 0, 21, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 9, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 80005, 0, 443, 105901, 0, 22, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 9, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 80005, 0, 444, 106401, 0, 30, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "主さま\n3.5周年まであと５日\nでございます", 80005, 0, 445, 105901, 0, 23, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "ですがその前に\n生放送がありますね", 80005, 0, 446, 105901, 0, 24, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "…生放送に向けた\n意気込みでございますか？", 80005, 0, 447, 105901, 0, 25, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 80005, 0, 448, 105901, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 80005, 0, 449, 105901, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 80005, 0, 450, 105901, 0, 28, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 80005, 0, 451, 105901, 0, 29, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 80005, 0, 452, 105901, 0, 30, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 0, 10, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 80005, 0, 453, 105901, 0, 31, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "3.5周年まであと４日！\nやばいですね☆", 80005, 0, 454, 105801, 0, 26, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 11, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 80005, 0, 455, 106001, 0, 32, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 80005, 0, 456, 105801, 0, 27, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 80005, 0, 457, 105801, 0, 28, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 80005, 0, 458, 105801, 0, 29, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 11, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 80005, 0, 459, 106001, 0, 33, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 80005, 0, 460, 105801, 0, 30, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 80005, 0, 461, 105801, 0, 31, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 80005, 0, 462, 105801, 0, 32, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 11, "だからあたしはやるなんて一言も…", 80005, 0, 463, 106001, 0, 34, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 0, 11, "オイッスー☆", 80005, 0, 464, 105801, 0, 33, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 11, "聞きなさいっての！！", 80005, 0, 465, 106001, 0, 35, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 12, "3.5周年まであと３日…\nそして生放送は、明日…", 80005, 0, 466, 106401, 0, 31, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 12, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 80005, 0, 467, 106401, 0, 32, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 12, "おいっす！\n…こうじゃなかったわね\nええと確か…", 80005, 0, 468, 106401, 0, 33, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 12, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 80005, 0, 469, 106401, 0, 34, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 12, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 80005, 0, 470, 106401, 0, 35, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 12, "やってますねシェフィちゃん！", 80005, 0, 471, 105801, 0, 34, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 12, "なによ、考えることは\nみんな同じってこと？", 80005, 0, 472, 106001, 0, 36, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 12, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 80005, 0, 473, 105901, 0, 32, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 12, "みんな…もちろんよ！", 80005, 0, 474, 106401, 0, 36, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 12, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 80005, 0, 475, 105801, 0, 35, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 13, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 80005, 0, 476, 190801, 0, 7, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 13, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 80005, 0, 477, 190801, 0, 8, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 13, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 80005, 0, 478, 105801, 0, 36, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 13, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 80005, 0, 479, 190801, 0, 9, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 13, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 80005, 0, 480, 105901, 0, 33, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 13, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 80005, 0, 481, 190801, 0, 10, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 13, "大丈夫…大丈夫…\nあたしは大丈夫…", 80005, 0, 482, 106001, 0, 37, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 13, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 80005, 0, 483, 190801, 0, 11, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 13, "あうー？", 80005, 0, 484, 106401, 0, 37, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("みんな", 4, 13, "あ…", 80005, 0, 485, 105801, 0, 37, 1, "105901,34,106001,38,190801,12");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 13, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 80005, 0, 486, 106001, 0, 39, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 13, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 80005, 0, 487, 105901, 0, 35, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 13, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 80005, 0, 488, 105801, 0, 38, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 80005, 0, 489, 190801, 0, 13, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 14, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 80005, 0, 490, 106401, 0, 38, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 14, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 80005, 0, 491, 105801, 0, 39, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 14, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 80005, 0, 492, 106001, 0, 40, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 14, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 80005, 0, 493, 105901, 0, 36, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 14, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 80005, 0, 494, 106401, 0, 39, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 14, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 80005, 0, 495, 105801, 0, 40, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 1, 14, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 80005, 0, 496, 105901, 0, 37, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 0, 14, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 80005, 0, 497, 106001, 0, 41, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 14, "へ、へぇ…", 80005, 0, 498, 106401, 0, 40, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 14, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 80005, 0, 499, 105801, 0, 41, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 14, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 80005, 0, 500, 106401, 0, 41, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 2, 14, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 80005, 0, 501, 106401, 0, 42, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 15, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 80005, 0, 502, 105801, 0, 42, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 15, "祝！", 80005, 0, 503, 106001, 0, 42, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 15, "3.5周年！", 80005, 0, 504, 105901, 0, 38, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 15, "おめでとうございます！", 80005, 0, 505, 106401, 0, 43, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 15, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 80005, 0, 506, 190801, 0, 14, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 2, 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 80005, 0, 507, 190801, 0, 15, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 15, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 80005, 0, 508, 105801, 0, 43, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 15, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 80005, 0, 509, 105801, 0, 44, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 15, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 80005, 0, 510, 106001, 0, 43, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("キャル", 1, 15, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 80005, 0, 511, 106001, 0, 44, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 15, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 80005, 0, 512, 106401, 0, 44, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("シェフィ", 0, 15, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 80005, 0, 513, 106401, 0, 45, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 15, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 80005, 0, 514, 105901, 0, 39, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 15, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 80005, 0, 515, 105901, 0, 40, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("コッコロ", 4, 15, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 80005, 0, 516, 105901, 0, 41, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("ペコリーヌ", 3, 15, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 80005, 0, 517, 105801, 0, 45, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("みんな", 4, 15, "これからも\nよろしくおねがいします！", 80005, 0, 518, 105801, 0, 46, 1, "105901,42,106001,45,106401,46,190801,16");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("カリン", 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60003, 0, 519, 190804, 1, 1, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 60003, 1, 520, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 60003, 1, 521, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 60003, 1, 522, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 60003, 1, 523, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 60003, 1, 524, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 60003, 2, 525, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 60003, 2, 526, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 60003, 2, 527, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 60003, 2, 528, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 60003, 2, 529, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 60003, 3, 530, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 60003, 3, 531, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 60003, 3, 532, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 60003, 3, 533, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 60003, 3, 534, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 60003, 3, 535, 0, 1, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 60003, 3, 536, 0, 2, 0, 0, "");
INSERT INTO `v1_b386303912d0832c225fae4287b06575d70e665cd16d74b22c26238f231c8dd7` VALUES ("", 2, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 60003, 4, 537, 0, 1, 0, 0, "");
